(1, 1, 'GET OUT AND CHECK IF YOUR INDICATORS CAN BE SEEN', 'STAY IN THE LEFT HAND LANE', 'KEEP WELL OVER TO THE RIGHT', 'GIVE  ARM SIGNAL AND INDICATOR  SIGNAL', ''),
(2, 2, 'FOLLOW CLOSELY OTHER VEHICLE\'S TAIL LIGHTS', 'NEVER USE DEMISTERS AND WINDSCREEN WIPERS', 'LEAVE PLENTY OF TIME FOR YOUR JOURNEY', 'KEEP SAFE DISTANCE OF TWO SECONDS', ''),
