(5, 5, 'THE CYCLIST MAY MOVE INTO THE LEFT AND DISMOUNT', 'THE CYCLIST MAY TURN EITHER WAY INTO THE ROAD', 'THE CONTENTS OF THE CYCLIST\'S CARRIER MAY FALL ONTO THE ROAD', 'THE CYCLIST MAY WISH TO TURN RIGHT AT THE END OF THE ROAD', ''),
(6, 6, '`L\'  MARK VEHICLES.', 'SLOW SPEED VEHICLES.', 'OLD VEHICLES.', 'LIGHT VEHICLES.', ''),
(7, 7, 'THEIR INTENTION IS ALWAYS TO DRIVE IN RIGHT HAND LANE.', 'THIS WILL REDUCE THEIR CONFIDENCE.', 'THEY MAY GET NERVOUS AND IT MAY LEAD TO AN ACCIDENT.', 'GENERALLY THEY ARE NOT MEDICALLY FIT.', ''),
(8, 8, 'MAKE SURE YOU STAY WELL BACK', 'LOOK OUT AS THEY MAY WOBBLE', 'BE AWARE THEY MAY SUDDENLY TURN EITHERWAY', 'ALL OF THE ABOVE', ''),
(9, 9, 'INTENDING TO TURN LEFT SHORTLY AFTERWARDS', 'APPROACHING A JUNCTION', 'THE VIEW AHEAD IS BLOCKED', 'ALL OF THE ABOVE', ''),
(10, 10, 'WHEN APPROACHING A ROUNDABOUT', 'ON A NARROW ROAD', 'JUST BEFORE YOU TURN LEFT', 'ON A RIGHT HAND BEND', ''),
(11, 11, 'GET PAST BEFORE IT MOVES', 'ALLOW IT TO PULL AWAY, IF IT IS SAFE TO DO SO', 'FLASH YOUR HEADLIGHTS AS YOU APPROACH', 'SIGNAL LEFT AND WAVE THE BUS TO MOVE ON', ''),
(12, 12, 'SOUND THE HORN', 'BRAKE FIRMLY', 'KEEP A SAFE GAP', 'FLASH YOUR LIGHTS', ''),
(13, 13, 'INCREASE YOUR SPEED.', 'BEAWARE OF SUDDEN BLAST OF WIND.', 'DRIVE ALONGSIDE VERY CLOSELY.', 'EXPECT NORMAL CONDITIONS.', ''),
(14, 14, 'CONTINUE DRIVING INTO THE INTERSECTION WITHOUT REDUCING SPEED.', 'SLOW DOWN AND BE CAREFUL', 'STOP AND ALLOW PEDESTRIANS TO CROSS', 'SOUND YOUR HORN REPEATEDLY', ''),
(15, 15, 'DRIVE TO ANOTHER INTERSECTION THAT HAS NO TRAFFIC LIGHT', 'WAIT UNTIL THE LIGHT TURNS GREEN BEFORE MAKING THE \"U\" TURN', 'MAKE THE \"U\" TURN IF THERE IS A POLICEMAN AT THE INTERSECTION.', 'AVOID MAKING A \'U\' TURN', ''),
