(18, 18, 'SOUND YOUR HORN', 'SWITCH ON YOUR HAZARD LIGHT', 'SWITCH ON YOUR FOG LIGHT', 'SWITCH ON YOUR HEADLIGHT TO FULL BEAM', ''),
(19, 19, 'CHECK THE MIRRORS AND CHANGE LANES', 'SPEED UP AND DRIVE OVER THE GRAVEL AS QUICKLY AS POSSIBLE.', 'SLOW DOWN', 'NONE OF THE ABOVE', ''),
