(21, 21, 'CROSS IT WHENEVER YOU FEEL', 'CROSS IT WHEN THERE IS NO TRAFFIC COMING FROM THE OPPOSITE DIRECTION', 'NEVER CROSS IT UNDER ANY CIRCUMSTANCES', 'CROSS IT WHEN IT IS SAFE TO DO SO BUT SHOULD COME BACK TO YOUR LANE AFTER OVERTAKING', ''),
(22, 22, 'WHENEVER YOU FEEL IT IS SAFE TO DO SO', 'WHEN THERE IS NO TRAFFIC COMING FROM THE OPPOSITE DIRECTION', 'UNDER NO CIRCUMSTANCES', 'BUT AVOID AS FAR AS POSSIBLE', ''),
