(24, 24, 'TRUE', 'FALSE', 'BOTH', 'NONE', ''),
(25, 25, 'SLOW DOWN AND GIVE WAY TO PEDESTRIANS', 'SPEED UP SINCE THE SIGNAL IS IN YOUR FAVOUR', 'SPEED UP BUT TAKE CARE OF THE PEDESTRIANS', 'NONE OF THE ABOVE', ''),
(26, 26, 'IF ROAD REPAIR WORK IS IN PROGRESS NEAR THE INTERSECTION', 'IF YOU WANT TO GIVE COIN TO A BEGGAR WHO IS A LITTLE AWAY FROM YOU', 'IF BY DOING SO, YOU WILL BE BLOCKING THE INTERSECTION', 'IF A POLICEMAN ON DUTY HAS SIGNALLED YOU TO STOP', ''),
(27, 27, 'YOU SHOULD SLOW DOWN AND DRIVE WITH INCREASED CAUTION.', 'YOU SHOULD SLOW DOWN, AND GIVE RIGHT WAY TO VEHICLES APPROACHING FROM LEFT OR RIGHT SIDE', 'SIGNAL LIGHT IS OUT OF ORDER AND AS SUCH YOU SHOULD PROCEED WITH CAUTION.', 'YOU SHOULD STOP, GIVE WAY TO VEHICLES IN THE PRIORITY ROAD AND PROCEED ONLY WHEN THE WAY IS CLEAR', ''),
