(415, 415, 'ట్యాంకులో ఇంధన స్థాయిని గమనిస్తూ ఉండాలి', 'రోడ్డుపై ఎదురవబోయే పరిస్థితులను అంచనా వేస్తూ ఉండాలి', 'వాహనం సాఫీగా నడిచేందుకు వాహనం యొక్క కాంట్రోల్స్ అన్నిటినీ నియంత్రిస్తూ ఉండాలి', 'వాహనం యొక్క అన్ని కంట్రోల్స్ ను నేరుగా గమనిస్తూ ఉండాలి', ''),
(416, 416, 'వేగాన్ని కొద్దిగా పెంచాలి', 'వేగాన్ని కొద్దిగా తగ్గించాలి', 'కాస్త ఖాళీగా ఉన్న రోడ్డును ఎంచుకోవాలి', 'విశ్రాంతి కోసం వాహనాన్ని సురక్షిత ప్రదేశంలో ఆపాలి', ''),
(417, 417, 'ఏంతో సౌకర్యముగా ఉంటుంది', 'మెడకు దెబ్బ తగలకుండా కాపాడుతుంది', 'విశ్రాంతి పొందడానికి ఉపయోగపడుతుంది', 'మీరు వాహనాని నడిపే భంగిమను అలాగే కొనసాగించేదుకు సహాయపడుతుంది', ''),
(418, 418, 'ఎవరైనా ఫోన్ చేసినప్పుడు', 'వాహనం ఆగి ఉంది సరిగ్గా పార్క్ చేసి ఉన్నప్పుడు', 'గంటకు 30 కి.మీ. తక్కువ వేగంతో వెళ్తున్నప్పుడు', 'గేర్లు లేని వాహనాన్ని నడుపుతున్నప్పుడు', ''),
(419, 419, 'ఇతర వాహనదారులు తప్పుగా ప్రవర్తించినా స్పందించకూడదు', 'హోర్డింగులను చూస్తూ డ్రైవింగ్ ను అశ్రద్ధ చేయకూడదు', 'ఇతర వాహనదారులు తప్పుగా ప్రవర్తించినా స్పందించకూడదు మరియు హోర్డింగులను చూస్తూ డ్రైవింగ్ ను అశ్రద్ధ చేయకూడదు.', 'డాష్ బోర్డు గేజ్ లను గమనిస్తూ ఉండిపోతే మీరు వాహనం నడపడం మీద ధ్యాస పెట్టలేకపోవచ్చు', ''),
(420, 420, 'కొద్దిగా విశ్రాంతి తీసుకోవాలి', 'ఇంధనాన్ని నింపుకోవాలి', 'భోజనం చేయాలి', 'ఏదైనా తాగాలి', ''),
(421, 421, 'అప్రమత్తంగా ఉండటం, జరుగబోయేది ముందుగా ఊహించగలగడం', 'ఎల్లప్పుడూ తక్కువ వేగంతో మృదువుగా నడపడం', 'ఎల్లప్పుడూ ఇతరులను ముందుకు వెళ్ళనివ్వడం', 'వేగంగా వెళ్ళే వాహనాల కోసం ఒక పక్కన ఆగిపోవడం', ''),
(422, 422, 'వాహనం యొక్క రిజిస్ట్రేషన్ కాగితాలు', 'ఎవ్వరు ఉండవలసిన అవసరం లేదు', 'లెర్నింగ్ లైసెన్స్ కలిగి ఉండాలి', '12 నెలలలోపు డ్రైవింగ్ పరీక్షకు హాజరు కావాలి', ''),
(423, 423, 'హాఫ్-మూన్ గ్లాసులు', 'గుండ్రని', 'బై-ఫోకల్', 'టింటెడ్', ''),
(424, 424, 'మీ దృష్టికి అడ్డొచ్చి మీ ధ్యాసను మళ్ళిస్తాయి', 'మీ డ్రైవింగ్ సామర్ధ్యాన్ని పెంచుతాయి', 'మీ ద్యాసను పెంచడానికి పనికొస్తాయి', 'ఏదీ సరైన సమాధానం కాదు', ''),
(425, 425, 'రాత్రి పూట డ్రైవింగ్ చేయకండి', 'విశ్రాంతి తీసుకునేందుకు ఆగండి', 'ఎటువంటి బరువులను తీసుకెళ్ళకండి', 'నాణ్యమైన విస్కీ రెండు పెగ్గులు తాగండి', ''),
(426, 426, 'వర్షం పడుతున్నప్పుడు', 'పొగమంచు ఉన్నప్పుడు', 'రాత్రి సమయంలో ', 'గాలి బలంగా వీస్తున్నప్పుడు', ''),
(427, 427, 'హెడ్ లైట్ల కాంతిని తగ్గించడానికి మీ సన్ గ్లాసులు ధరించాలి', 'మీ వాహనం యొక్క హెడ్ లైట్లను ‘లో భీమ్’లోకి మార్చాలి', 'హజార్డ్ వార్నింగ్ లిట్లను ఆన్ చేయాలి', 'వేగంగా వెళ్ళిపోవాలి', ''),
(428, 428, 'మోటారు సైకిల్ నడిపెవారికి', 'సైక్లిస్ట్ లకు', 'పాదచారులకు', 'అన్ని సమాధానాలూ సరైనవే', ''),
(429, 429, 'వారి ఉనికిని మీకు తెలియజేయడానికి', 'ముందర ఏదో ప్రమాదం పొంచి ఉందని తెలుపడానికి', 'మీరు వేగా పరిమితులు దాటి వెళ్తున్నారని హెచ్చరించడానికి', 'మీకు దారి ఇస్తున్నామని చెప్పడానికి', ''),
(430, 430, 'కారు నుండి దిగి చుట్టూ ఉన్న ప్రదేశాన్ని గమనించి వాహనాన్ని వేగంగా నడుపుకుంటూ పోవాలి', 'హారన్ ను నిరంతరం మొగిస్తూనే ఉండాలి', 'బయలుదేరే ముందే మిర్రర్లనుంచి, భుజాలపై నుంచి చుట్టూ గమనించాలి', 'అన్ని సమాధానాలూ సరైనవే ', ''),
(431, 431, 'పాదచారులకు రోడ్డుపై ప్రత్యేక అధికారాలేవీ లేవు', 'పాదచారులకు జీబ్రా లైన్ వద్ద మాత్రమే రోడ్డు వెళ్లేందుకు అనుమతించాలి. ', 'పాదచారుల హక్కు వారు రోడ్డు దాటినంత వరకు ఆగాలి', 'ఏదీ సరైన సమాధానం కాదు', ''),
(432, 432, 'పాదచారులపై నీళ్ళు చిమ్మకుండా వాహనాన్ని రోడ్డు మధ్యలో ఆపాలి', 'వేగంగా, ప్రమాదభరితంగా రోడ్డు దాటుతున్న పాదచారులను గమనించాలి', 'ఆగి, వృద్ధులను రోడ్డు దాటడానికి సహాయపడాలి', 'నిర్దిష్టమైన వేగంలోనే వాహనాన్ని నడపాలి', ''),
(433, 433, 'నల్ల త్రికోణం', 'ఎరుపు త్రికోణాకారం', 'నీలం దీర్ఘ చతురస్రాకారం', 'ఎరుపు/నీలం రంగు వృత్తాకారం', ''),
(434, 434, 'మరే ఇతర వాహనాలు లేని సమయంలో తిన్నగా ముందుకు పోవచ్చని అర్థం', 'తెల్లని స్టాప్ లైన్ వెనకే ఆగాలని అర్థం', 'ఎటువంటి ప్రమాదం లేదనిపిస్తే ఎడమవైపునకు తిరగొచ్చు', 'ఇతర వాహనాలు బయలుదేరితే వెంటనే ఆపడానికి వీలుగా వేగాన్ని తగ్గించాలి', ''),
(435, 435, 'గంటకు 50 కిలోమీటర్ల వేగంతో', 'రాత్రివేళల్లో', 'పర్మనెంటు లైసెన్స్ వున్నా వ్యక్తి మీ వాహనంలో లేనప్పుడు', 'ఏదీ సరైన సమాధానం కాదు', ''),
(436, 436, 'ప్రమాదంలో మీ వాహనం చిక్కుకున్నప్పుడు', 'రెడ్ సిగ్నల్ పడినప్పుడు', 'పోలీస్ అధికారి ఆపమని సిగ్నల్ ఇచ్చినప్పుడు', 'పై అన్ని సందర్భాల్లోనూ', ''),
(437, 437, 'బ్యాటరి అయిపోకుండా ఉండేందుకు', 'ఇతర వాహనాల వారు తప్పుగా అర్ధం చేసుకోకుండా ఉండడానికి', 'రోడ్డుపై ఉన్న ఇతరులకు కళ్ళు చెదరకుండా ఉండేందుకు', 'ఇండికేటరు రిలే పాడైపోకుండా ఉండటానికి', ''),
(438, 438, '15 మీటర్లు', '10 మీటర్లు', 'ముందు వెళ్తున్న వాహనం వేగంపై ఆధారపడి ఉంటుంది', 'ముందు వెళ్తున్న వాహనం హఠాత్తుగా వేగం తగ్గించినా లేదా ఆగినా మీరు దాన్ని ఢీకొనకుండా ఉండేలా చూసుకోవాలి.', ''),
(439, 439, 'కదులుతున్న వాహనం వలన మీకు ప్రమాదం ఏర్పడుతుందని భావించినపుడు', 'ఎప్పుడు పడితే అప్పుడు', 'చాలా తక్కువ సమయం పాటు', 'మీరు అప్పుడే వచ్చారని తెలియజేయడానికి', ''),
(440, 440, '“రాడార్ స్పీడ్ ట్రాప్” ముందుందని ', 'వాళ్ళు మీకు దారి ఇస్తున్నారని', 'అక్కడ తామున్నట్లు మిమ్మల్ని హెచ్చరిస్తున్నారని', 'మీ వాహనంలో ఏదో లోపముందని', ''),
(441, 441, 'ఇంజన్ శబ్దం సరిగ్గా ఉంటేచాలు, ఆగకుండా వెళ్ళవచ్చు', 'అదో తాత్కాలిక విద్యుత్ లోపమని సరిపెట్టుకోవాలి', 'మరోసారి ఎక్కువ సమయం దొరికినప్పుడు ఆ సమస్యను తీర్చడానికి ప్రయత్నించాలి', 'వెంటనే అసలు సమస్య ఎక్కడుందో జాగ్రత్తగా పరిశీలించాలి', ''),
(442, 442, 'స్పీదోమేటర్', 'హార్న్', 'విండ్ స్క్రీన్ వైపర్', 'అన్ని సమాధానాలు సరైనవే', ''),
(443, 443, 'వెనుకనుంచి వచ్చే వాహనాలను గమనించడానికి', 'వెనుక సీట్లో కూర్చున్న ప్రయానికుల మీద ఓ కన్నేసి ఉంచడానికి ', 'వాహనంలో దీనవసరం లేదు', 'దీని వాళ్ళ దృష్టి మరలి ప్రమాదం జరిగే అవకాశం కూడా ఉంది', ''),
(444, 444, 'వేగాన్ని తగ్గించడానికి', 'వాహనాన్ని పార్క్ చేయడానికి', 'హటాత్తుగా బ్రేక్ వేయడానికి', 'జారిపదకుండా ఉండేందుకు', ''),
(445, 445, 'సీట్ బెల్ట్', 'డోర్ల రక్షణ కవచాలు', 'ప్యాడేడ్ ఇన్స్ట్రుమెంట్ ప్యానెల్', 'ఏది సరైన సమాధానం కాదు', ''),
(446, 446, 'ఇంకొకరి కారును ఎప్పుడూ ఉపయోగించకూడదు', 'అసౌకర్యంగా ఉన్నా అలాగే ఉపయోగించుకోవాలి. ఇతరుల సీట్ల స్థానాన్ని మార్చకూడదు.', 'మీకు అనువుగా ఉండేలా సీటు స్థానాన్ని అడ్జస్ట్ చేసుకోవాలి', 'మీ మిత్రుడిని అడిగి ఒక దిండును మీ వెనుక ఉంచుకోవాలి', ''),
(447, 447, 'అస్సలు కనిపించని బ్లయిండ్ స్పాట్లను కనిపించేలా చేయడానికి', 'కనిపించే ప్రదేశాల విస్తీర్ణం పెరగడానికి', 'వెనుక వస్తున్నా వాహనాల వేగాన్ని సులువుగా అంచనా వేయగాలిగేందుకు', 'వెనుక వస్తున్నా వాహనాలు పెద్దగా కనిపించడానికి', ''),
(448, 448, 'నల్లని ప్లేటుపై తెల్లని అక్షరాలూ', 'పసుపు ప్లేట్ పై తెల్లని అంకెలు ఉండాలి', 'తెల్లని ప్లేట్ పై  నల్లని ఆకులు ఉండాలి', 'పైవేవీ సమాధానాలు కావు', ''),
(449, 449, 'పగటి పూట డ్రైవ్ చేయడానికి', 'చాలా తక్కువ ట్రాఫిక్ ఉన్న రోడ్డుపై డ్రైవింగ్ చేయడానికి', 'ఎప్పుడైనా, ఎక్కడైనా నడపవచ్చు', 'ఎప్పుడైనా, ఎక్కడైనా ద్విచక్ర వాహనాన్ని నడపవచ్చు.  కానీ ద్విచక్ర వాహనాన్ని నడిపేందుకు శాశ్వత లైసెన్స్ ఉన్న వ్యక్తీ మాత్రమె మీ వెనుక ఉండాలి.', ''),
(450, 450, 'మోటార్ కార్లను మాత్రమె ', 'మోటార్ కార్లు, 50సిసి కంటే ఎక్కువున్న మోటార్ సైకిల్స్', 'ఏ మోటార్ వాహనాన్నైన ', 'ఇవేవి సరైన సమాధానాలు కావు', ''),
(451, 451, 'జరిగిన నష్టానికి పాక్షిక నష్టపరిహారాన్ని చెల్లిస్తుంది.', 'జరిగిన నష్టానికి పూర్తి నష్టపరిహారాన్ని చెల్లిస్తుంది.', 'జరిగిన నష్టానికి ఎటువంటి నష్టపరిహారాన్ని చెల్లించదు.', 'ఇవేవీ సమాధానాలు కావు', ''),
(452, 452, 'ఏదైనా ప్రమాదంలో ఇరుక్కున్నప్పుడు', 'పోలీస్ అధికారి మిమ్మల్ని నియంత్రించినప్పుడు', 'ఎటువంటి చట్టబద్దమైన చర్యకు లోనుకారు', 'పైవేవీ సమాధానాలు కావు', ''),
(453, 453, '30 రోజులు ', 'శాశ్వత లైసెన్స్ వచ్చేదాకా', '6 నెలలు', 'ఒక ఏడాడి', ''),
(454, 454, 'ప్రైమరీ అన్ లైసెన్స్ కార్ అండ్ క్యారియర్', 'పొల్యూషన్ అండర్ కంట్రోల్ సర్టిఫికెట్', 'పొల్యూషన్ అన్ కంట్రోల్ సర్టిఫికెట్', 'పైవేవీ సమాధానాలు కావు', ''),
(455, 455, '20 సంవత్సరాలు', '15 సంవత్సరాలు', '16 సంవత్సరాలు', '18 సంవత్సరాలు', ''),
(456, 456, 'గాయపడిన వారిని ఆసుపత్రికి తరలించి, దగ్గరగా ఉన్న పోలీస్ స్టేషన్ లో తెలియచేయాలి', 'పోలీసులకు తెలియపరచాల్సిన అవసరం లేదు', 'పోలీసులకు తెలియపరచాల్సిన అవసరం లేదు కానీ, గాయపడిన వారిని ఆసుపత్రికి తరలించాలి', 'పారిపోవాలి', ''),
(457, 457, 'అది అడ్డుకుంటున్న పద్దతిపై ఆధారపడి ఉంటుంది', 'అవును, అది ఎప్పుడైనా నేరమే ', 'కాదు, మీరు కావాలనుకుంటే నెంబరు ప్లేట్ ను కప్పి ఉంచుకోవచ్చు', 'అవు ఉంచితే నేరం కాదును, టో-బారులు లేదా బైసికల్ ర్యకులు నెంబర్ ప్లేట్ ను మూసి', ''),
(458, 458, 'అవును, కూడళ్ళ వద్ద ఆపినప్పుడు మాత్రమే ఉపయోగించాలి', 'అలా ఎప్పుడూ చేయకూడదు', 'అవును, కనీసం ఒక చేతితోనైనా స్టీరింగ్ వీల్ ను పట్టుకొని ఉండాలి', 'రాత్రివేళల్లో మాత్రమే ఉపయోగించవచ్చు.', ''),
(459, 459, 'ఆ ప్రాంతానికి రక్షణ కల్పించాలి', 'అధికారులకు తెలియజేయాలి', 'దెబ్బలు తగిలిన వారికి చికిత్స అందించాలి', 'పైవన్నీ…', ''),
(460, 460, '197', '100', '108', '101', ''),
(461, 461, 'పోలీసులకు తెలియజేయాలి', 'ఇతర వాహనాల వారిని హెచ్చరించాలి', 'అంబులెన్సుకు ఫోన్ చేయాలి', 'పైవేవీ సమధానాలు కావు', ''),
(462, 462, 'వాహనాలు నదిపేవారి పొరపాటు వల్ల', 'వాహనాలు సరిగ్గా పనిచేయకపోవడం వల్ల', 'రోడ్డు, వాతావరణ పరిస్థితులు అనుకూలంగా లేకపోవడం వల్ల', 'పైవన్నీ సరైన సమాధానాలే..', ''),
(463, 463, '36-45 వయసువారు', '58 వయసు పైబడ్డ వారు', '46-55 వయసువారు', '17-25 వయసువారు', ''),
(464, 464, 'రోడ్డుపై ఉండే సిగ్నల్స్ ను సరిగ్గా అర్ధం చేసుకోలేకపోతారు', 'వారి కారుకు ఇన్సూరెన్స్ దొరకదు', 'వేగంగా స్పందించలేరు', 'సిగ్నల్స్ ను సరిగ్గా ఇవ్వలేరు', ''),
(465, 465, 'సమీపంలో ఇతర వాహనాలేవీ లేవని నిర్ధారించుకున్నప్పుడు', 'మీకు ఒంటి చేత్తో వాహనాన్ని నడపగలిగే సామర్థ్యం ఉన్నప్పుడు', 'మీ ముందున్న రోడ్డు మీద మీ ధ్యాసను అది తగ్గిస్తుంది కాబట్టి', 'ఇంజన్ పనిచేస్తున్న సమయంలో సెల్ ఫోన్ సిగ్నల్ సరిగ్గా ఉండదు కాబట్టి', ''),
(466, 466, 'వాహనం నడిపే ముందు వైద్యుల సలహా తీసుకోవాలి', 'అత్యవసరమైన ప్రయాణాలకు పరిమితం కావాలి', 'శాశ్వత లైసెన్స్ కలిగి ఉన్న వ్యక్తి తోడుగా ఉన్నప్పుడు మాత్రమే వాహనాన్ని నడపాలి', 'తక్కువ దూరాలు మాత్రమే నడపాలి', ''),
(467, 467, 'డ్రైవింగ్ మొదలు పెడతారు కానీ ఒక కిటికీ తెరచి ఉంచుతారు', 'మామూలు కంటే తక్కువ వేగంతో వాహనాన్ని నడుపుతూ రేడియోను ఆన్ చేస్తారు', 'వాహనం నడిపే ముందు రిలాక్స్ అవడం కోసం కొద్దిగా మద్యం సేవిస్తారు', 'మానసిక అలజడి తగ్గినా తర్వాతనే వాహనం నడపడానికి ప్రయత్నిస్తారు', ''),
(468, 468, 'కాస్త ఆగి విశ్రాంతి తీసుకుంటే', 'గట్టిగా అరుస్తూ తిడితే', 'చేతితో సైగలు చేస్తే', 'హెడ్ లైట్లను ఫ్లాష్ చేస్తూ ఆ కారును వెంబడించినట్లయితే', ''),
(469, 469, 'భారత దేశమంతా చెల్లుతుంది', 'ప్రపంచమంతా చెల్లుతుంది', 'ఆ రాష్ట్రంలో మాత్రమే చెల్లుతుంది', 'ఎక్కడా చెల్లదు', ''),
(470, 470, 'మీ ఉనికి ఇతరులకు తెలియజేయడానికి', 'దారిలో వెళ్లేందుకు మీకున్న హక్కును తెలియజేయడానికి', 'ఇతరులను పలకరించడానికి', 'మీ విసుగును తెలియజేయడానికి', ''),
(471, 471, 'ఆ వాహనంలోని కంట్రోల్ల్స్ అన్నియు తెలిసిఉండా', 'శుభ్రంగా స్నానం చేసి వాహనాన్ని నడపడానికి తయారవ్వాలి', 'వాహనాన్ని స్టార్ట్ చేసే ముందు ప్రతీసారి చోక్ ను ఉపయోగించాలి', 'దాని నెంబరు ప్లేట్లు సరిగ్గా ఉన్నాయోలేదో చెక్ చేయాలి', ''),
(472, 472, 'కంటిచూపు', 'మాట', 'సంచలన (బ్యాలెన్స్)', 'నిర్ణయాత్మక శక్తి (జడ్జ్మెంట్)', ''),
(473, 473, 'రెండు పెగ్గులు మాత్రమే తీసుకోవాలి', 'అసలు మద్యాన్ని సేవించకూడదు', 'మద్యాన్ని సేవించే ముందు కొద్దిగా పాలు తాగాలి', 'మద్యంతో పాటు వేడి భోజనం కూడా చేయాలి', ''),
(474, 474, 'ఒక కప్పు స్ట్రాంగ్ కాఫీ తాగిన తర్వాత వాహనాన్ని నడపాలి', 'జాగ్రత్తగా, మెల్లగా నడుపుకుంటూ ఇంటికి వెళ్ళాలి', 'సిటీ బస్సులను ఉపయోగించి ఇంటికి చేరుకోవాలి', 'కొద్దిసేపు ఆగిన తర్వాత ఆ వాహనం నడుపుతూ ఇంటికి వెళ్ళాలి', ''),
(475, 475, 'మాదక ద్రవ్యాలు', 'అలసట', 'పెద్దగా శబ్దం చేసే సంగీతం', 'అన్ని సమాధానాలు సరైనవే', ''),
(476, 476, 'వాహనాన్ని నడిపే వ్యక్తి ఇప్పుడు కావాలంటే అప్పుడు డోరును తెరవచ్చు', 'వెనుక వస్తున్నా వారెవరికైనా అడ్డొస్తుందనుకుంటే డోర్ తెరవకూడదు', 'ఈ పరిస్థితి గురించి చెప్పే నిబంధన ఏదీ లేదు', 'ట్రాఫిక్ ను అడ్డుకునే లేదా ప్రమాదం కలిగించే అవకాశమున్నప్పుడు మీరు తలుపు తెరవకూడదు', ''),
(477, 477, 'మీ హార్న్ మోగించాలి', 'వెంటనే ఆగిపోవాలి', 'అత్యవసర వాహనాన్ని దాటనిచ్చి దాని వెనుకనే వెంబడించాలి', 'అత్యవసర వాహనం మిమ్మల్ని దాటిపోయేదాకా మీ వాహనాన్ని రోడ్డుకు ఎడమవైపుకు ఆపాలి', ''),
(478, 478, 'అతనిని రోడ్డు మీద నుండి ఒక పక్కకు లాగాలి', 'ఇతర వాహనాలను హెచ్చరించాలి', 'రోడ్డు మీద చెత్తను తొలగించాలి', 'పడివున్న వ్యక్తికీ ధైర్యంచెప్పాలి', ''),
(479, 479, 'నేను వాహనాన్ని నడిపేటప్పుడు నా భద్రతతోపాటు, రోడ్డుపై ప్రయాణిస్తున్న ఇతరుల భద్రతా కూడా నా భాధ్యతేనని భావిస్తాను', 'ఢీ కొట్టడం లేదా ఢీ కొట్టకపోవడం అన్నది అదృష్టం మీద ఆధారపడి ఉంటుంది', 'రోడ్డు మీద ఉన్న ఇతరుల భద్రతా బాధ్యత వారిదే', 'మిగిలిన డ్రైవర్లు వేగంగా వెళ్తుంటారు. నేనుమాత్రం సురక్షిత ప్రమాణాలనే పాటిస్తాను', ''),
(480, 480, 'మిగతా ట్రాఫిక్ ను హెచ్చరించాలి', 'మీ వెనుక ట్రాఫిక్ ను ఆపి సహాయం చేయమని అడగాలి', 'మీ వాహనాన్ని తొందరగా మరమ్మత్తు చేసేందుకు ప్రయత్నించాలి', 'రోడ్డుపై హెచచ్రిక సూచికను అందించే ట్రయాంగిల్ ను ఉంచాలి', ''),
(481, 481, 'ప్రధమ చికిత్స కిట్', 'రోడ్డు మ్యాప్', 'మండే గుణం కలిగిన పదార్థాలు', 'టూల్ కిట్', ''),
(482, 482, 'పాదచారులకు అన్ని పాదచారుల క్రాసింగ్ వద్ద దాటే హక్కు ఉంది', 'పాదచారులకు రోడ్డు దాటే హక్కు లేదు', 'పాదచారులు  సరిగా దారి ఇవ్వాలి', 'పాదచారులు రోడ్డు క్రొస్సింగ్స్ వద్ద నెమ్మదిగా దాటాలి', ''),
(483, 483, ' 60KMPH', ' 50KMPH', ' 24KMPH', ' 10KMPH', ''),
(484, 484, ' సైలెంట్ ప్రదేశాలలో హార్న్ మ్రోగించరాదు', ' మల్టీ టోన్డ్ హోర్న్స్ ఉపయోగించరాదు', ' ఎక్కువ శబ్దం చేస్తున్న వాహనాన్ని నడపరాదు', ' పైవన్నీ', ''),
(485, 485, ' 25 KMPH', ' 35 KMPH', '45 KMPH', ' 55 KMPH', ''),
(486, 486, ' 35 KMPH', '25 KMPH', ' 45 KMPH', ' 55 KMPH', ''),
(487, 487, ' ట్రైలర్స్ పై తీసుకెళ్లవచ్చు', 'వాహనం బాడీ మీద తీసుకెళ్లవచ్చు', 'అద్దె కొరకు తీసుకెళ్లవచ్చు', 'ఎట్టి పరిస్థితులలోను తీసుకెళ్లకూడదు', ''),
(488, 488, 'డ్రైవింగ్ లైసెన్స్', ' రిజిస్ట్రేషన్ సర్టిఫికెట్', ' ఇన్సూరెన్సు సర్టిఫికెట్', ' ఇన్వాయిస్', ''),
(489, 489, ' యూనిఫామ్ లో ఉన్న పోలీసు అధికారికి', ' యూనిఫామ్ లో ఉన్న రవాణా అధికారికి', ' గవర్నమెంట్ నియమించిన ఏదైనా అధికారికి', 'పైవన్నీ', ''),
(490, 490, ' 60 KMPH', '80 KMPH', ' 50 KMPH', ' 100 KMPH', ''),
(491, 491, 'గేర్ ను న్యూట్రల్ లోకి తీసుకోవాలి', 'ఇంజన్ ను ఆపివేయాలి', ' ఒక్కో గేరును తగ్గించుకుంటూ లోయర్ గేరునకు రావాలి', ' క్లచ్ ను, బ్రేక్ ను ఒకేసారి నొక్కాలి', ''),
(492, 492, ' ఎక్కువ శబ్దంతో కూడిన సంగీతం', ' తోటి ప్రయాణికుడితో వాదించడం', ' మొబైల్ ఫోన్ ఉపయోగించడం', ' అన్ని సరైన సమాధానాలే', ''),
(493, 493, ' మోటార్ వేని వదిలి అనువైన ప్రదేశంలో ఆగి చల్లటి తాజా గాలి మీ వాహనంలోకి వెళ్లేలా చేయాలి', ' చుట్టూ ఉన్న పరిసరాల అందాలు గమనిస్తూ ఉండాలి', ' వేగాన్ని పెంచి మీ ప్రయాణాన్ని తొందరగా ముగించేందుకు ప్రయత్నించాలి', 'విశ్రాంతి కోసం ఎక్కడైనా ఆగాలి', ''),
(494, 494, ' హెడ్ లైట్స్', ' ముందు అద్దాలు', ' సీట్ బెల్ట్స్', ' పైవన్నీ', ''),
(495, 495, ' పిల్లల తల్లిదండ్రులది', ' వాహనాన్ని నడిపే డ్రైవర్ ది', 'ముందు సీటులో ఉన్న ప్రయాణికులది', ' పిల్లలది', ''),
(496, 496, ' మానసిక సమతుల్యత దెబ్బతింటుంది', ' డ్రైవర్ యొక్క ఏకాగ్రత దెబ్బతింటుంది', 'వినికిడి సామర్ధ్యం దెబ్బతింటుంది', ' అన్ని సమాధానాలు సరైనవే', ''),
(497, 497, 'ఏవిధంగానూ స్పందించవద్దు', ' మీరేం చేయదలచుకున్నారో వాళ్ళు  తెలుసుకునేలా చేయండి', ' అదేపనిగా హెడ్ లైట్లను ఫ్లాష్ చేయండి', 'హారన్ మ్రోగించండి', ''),
(498, 498, ' హారన్ మ్రోగించి మీ ఉనికిని వారికి తెలియజేయాలి', ' పరిస్థితులకు తొందరగా స్పందించలేరు కాబట్టి మీరు సహనం కోల్పోకూడదు', ' మీ హెడ్ లైట్స్ ఫ్లాష్ చేస్తూ వారు ముందుకు వెళ్లోద్దని సూచించాలి', 'వీలైనంత తొందరగా వారిని ఓవర్ టేక్ చేయాలి', ''),
(499, 499, ' మీరు దారి ఇస్తున్నట్లు తెలియజేయడానికి', 'మీరు మలుపు తిరుగుతున్నట్లు తెలియచేయడానికి', ' ముందుకెళ్లేందుకు మీకు హక్కుందని తెలియజెప్పేందుకు', 'మీరు అక్కడే ఉన్నారని తెలియజెప్పడానికి', ''),
(500, 500, 'ఇంధన వినియోగం పెరుగుతుంది', 'ఇంజన్ బాగా వేడెక్కడానికి కారణమవుతుంది', ' వాహనంపై నియంత్రణ తగ్గుతుంది', 'టైర్లు ఎక్కువగా అరుగుతాయి', ''),
(501, 501, ' లోయర్ గేర్ కు మార్చాలి', 'రివర్స్ గేర్ ఎంచుకోవాలి', ' హయ్యర్ గేర్ కు మారాలి', ' న్యూట్రల్ గేర్ కు మారాలి', ''),
(502, 502, ' ఇంధన వినియోగం ఎక్కువగా ఉంటుంది', ' వాహనం వేగం అమాంతంగా పెరుగుతుంది', ' దీనివల్ల ఇంజన్ దెబ్బతింటుంది', ' టైర్లు తొందరగా అరుగుతాయి', ''),
(503, 503, ' పెరుగుతుంది', ' తగ్గుతుంది', ' పదిరెట్లు పెరుగుతుంది', ' అంతే ఉంటుంది', ''),
(504, 504, ' థర్డ్ పార్టీ, ఫైర్ అండ్ తెఫ్ట్', 'ఫుల్లీ కాంప్రహెన్సివ్', ' థర్డ్ పార్టీ మాత్రమే', ' వ్యక్తిగత గాయాల భీమా', ''),
(505, 505, '14 రోజులలోపు', ' 28 రోజులలోపు', 'ఒక నెలలోపు', ' భీమా చేసే సమయంలో', ''),
(506, 506, ' వాహనపు ఇంజన్ ఆపాలి', 'గాయపడిన వారిని వాహనాలకు దూరంగా జరపాలి', 'అత్యవసర సేవలను అందించే వారికి ఫోన్ చేయాలి', ' అన్ని సరైన సమాధానాలే', ''),
(507, 507, ' ఆ వ్యక్తి తేరుకునేలా చేయాలి', 'ఇతర వాహనాలను హెచచరించాలి', ' కోలుకోవడానికి అనువైన భంగిమలోకి మార్చాలి', ' గాయపడిన వ్యక్తికి వెచ్చటి వాతావరణం కల్పించాలి', ''),
(508, 508, 'గాయపడ్డ వారికి వెచ్చగా సౌకర్యవంతంగా ఉండేలా చూడాలి', 'వారితో మాట్లాడుతూ మేరె ప్రమాదం లేదని భరోసా ఇస్తూవరు ప్రశాంతంగా ఉండేలా చేయాలి', ' గాయపడ్డ వాళ్ళు ఒంటరిగా ఉండకుండా చూడాలి', ' అన్ని సమాధానాలు సరైనవే', ''),
(509, 509, 'ఇండికేటర్లను వేస్తూనే చేతితో సిగ్నల్ ఇవ్వాలి', ' ఇండికేటర్ ను చాలా ముందుగానే వేయాలి', 'బ్రేక్ ను పదే పదే నొక్కుతూ స్టాప్ లైట్స్ ఎక్కువసార్లు వెలిగేలా చేయాలి', ' వీలైనంత తొందరగా మలుపు తిరగాలి', ''),
(510, 510, 'డ్రైవింగ్ లైసెన్స్', ' డ్రైవింగ్ లైసెన్స్ మరియు ఇన్సూరెన్సు సర్టిఫికెట్', 'డ్రైవింగ్ లైసెన్స్ , ఇన్సూరెన్సు, రిజిస్ట్రేషన్ సర్టిఫికెట్, కాలుష్య', 'ఈ డాక్యూమెంట్లు తీసుకువెళ్తే ఎవరైనా అపహరించవచ్చు', ''),
(511, 511, '180 రోజులు', ' 30 రోజులు', ' 60 రోజులు', '90 రోజులు', ''),
(512, 512, 'ఏమీ ఉండదు', '30 రోజులు', '60 రోజులు', '90 రోజులు', ''),
(513, 513, ' రిజిస్ట్రేషన్ లేనప్పుడు', ' అవసరం లేకుండా హెడ్ లైట్స్ వెలిగించినప్పుడు', ' రిజిస్ట్రేషన్ నెంబరు నిర్ధేశించిన పరిణామంలో లేనప్పుడు', 'రిజిస్ట్రేషన్ ప్లేట్ తప్పుడు రంగులో ఉన్నప్పుడు', ''),
(514, 514, ' మీ స్పందనను, వేగాన్ని పెంచుతుంది', ' మీ ఏకాగ్రతను తగ్గిస్తుంది', 'మీ చైతన్న్యాన్ని పెంచుతుంది', 'మీ సమన్వయాన్ని మెరుగుపరుస్తుంది', ''),
(515, 515, ' వేగాన్ని పెంచాలి కానీ, పెడస్ట్రియన్స్ క్రాసింగ్ పై ఉన్న పాదచారులను ఢీ కొట్టకుండా  నివారించాలి', ' వేగాన్ని తగ్గించి ముందుకెళ్లాలి', ' ఆగి, అప్పటికే పెడస్ట్రియన్స్ క్రాసింగ్ పై ఉన్నవారికి దారి వదలాలి', ' అప్పటికే పెడస్ట్రియన్స్ క్రాసింగ్ పై ఉన్నపాదచారులు దృష్టిలో ఉంచుకుంటూ వేగాన్ని పెంచాలి', ''),
(516, 516, ' వేగాన్ని తగ్గించి అవసరమైతే ఆగాలి', 'రోడ్డుకు ఎడమవైపునకు చూస్తూ వేగాన్ని తగ్గించి, హెడ్ లైట్లను లోబీమ్ తో వెలిగించాలి', ' మీ హెడ్ లైట్లను అలా డిప్ చేసే ఉంచాలి', 'వేగాన్ని పెంచాలి', ''),
(517, 517, 'డ్రైవింగ్ లైసెన్స్', ' రిజిస్ట్రేషన్ డాక్యుమెంట్', ' ఇన్సూరెన్స్ సర్టిఫికెట్', ' పి.యు.సి.  సర్టిఫికెట్', ''),
(518, 518, 'వాహనాన్ని వెంటనే రోడ్డు పక్కకు ఆపి ఇంజన్ తో పాటు ఎలక్ట్రికల్ స్విచ్ లన్నింటినీ ఆఫ్ చేసి కాలిన వైర్లను ఇసుక లేదా దళసరి బట్టతో నొక్కి పట్టాలి', ' వాహనాన్ని వెంటనే రోడ్డు పక్కకు ఆపి ఇంజన్ తో పాటు ఎలక్ట్రికల్ స్విచ్లన్నిటినీ ఆఫ్ చేసి కాలిన వైరుపై నీరు పోస్తూ, వాటిని నొక్కిపెట్టాలి', ' మీరేమీ చేయొద్దు, కేవలం అగ్నిమాపక దళానికి కబురు చేయాలి', 'ఏది సరైన సమాధానం కాదు', ''),
(519, 519, 'వాహనంపై నియంత్రణ తగ్గుతుంది. ఫలితంగా క్లచ్', ' గేర్ బాక్స్ అరుగుదల పెరుగుతుంది', ' పెట్రోల్ వినియోగం తగ్గుతుంది', ' టైర్ల యొక్క గ్రిప్ తగ్గుతుంది', ''),
(520, 520, ' ఇంధనాన్ని, గాలిని సరైన మోతాదులో కలుపుతుంది', ' ఇంధనాన్ని, గాలిని తక్కువ మోతాదులో కలుపుతుంది', ' ఇంధనాన్ని, గాలిని, నీటిని తక్కువ మోతాదులో కలుపుతుంది', 'ఏది సరైన సమాధానం కాదు', ''),
(521, 521, ' ఇతర వ్యక్తి యొక్క గాయాలకు', 'ఇతరుల ఆస్తికి జరిగిన నష్టాన్ని', 'ఇతరుల వాహనాలకు జరిగిన డ్యామేజ్ ను', ' అనీ సరైన సమాధానాలే', ''),
(522, 522, ' మీకు పెద్ద పెడల్స్ కనిపించవు', 'తడిసిన బ్రేకులు చల్లగా ఉంటాయి', ' టైర్లకు టొడ్డుపై పట్టు తక్కువగా ఉంటుంది', ' విండ్ స్క్రీన్ పై నీటివల్ల మీకు సరిగా కనిపించదు', ''),
(523, 523, 'సరుకులు జారిపడకుండా ఉండేటట్టు సరిగా తాళ్లతో కట్టుకోవాలి', ' తిరిగి దింపేందుకు వీలుగా ఉండేటట్లు చేసుకోవాలి', ' దెబ్బతినకుండా చూసుకోవాలి', 'వాహనానికి దెబ్బ తగలకుండా చూసుకోవాలి', ''),
(524, 524, 'వికలాంగుడు', ' చెవిటివాడు', ' వృద్ధుడు', 'గుడ్డివాడు', ''),
(525, 525, ' పని రోజుల్లో (వర్కింగ్ డేస్) మాత్రమే ఆ ఆదేశాన్ని పాటించాలి', 'అన్ని సమయాల్లోనూ ఆ ఆదేశాన్ని పాటించాలి', ' ఇరుకుగా ఉన్న వీధుల్లో ఆ ఆదేశాన్ని పాటించాలి', ' చీకటిగా ఉం న సమయంలో ఆ ఆదేశాన్ని పాటించాలి', ''),
(526, 526, 'గట్టిగా కట్టి ఉంచాలి', ' తప్పనిసరి అయినప్పుడు మాత్రమే తీసుకు వెళ్ళాలి', ' సాధ్యమైనంత తేలిక వస్తువులు తీసుకువెళ్ళాలి', ' ప్లాస్టిక్ షీట్ తో కప్పాలి', ''),
(527, 527, 'కార్ల కంటే లారీలు పొడవుగా ఉంటాయి', 'లారీలు హఠాత్తుగా వేగం పుంజుకోవచ్చు', ' లారీలు బ్రేకులు అంత  బాగా పనిచేయవు', ' లారీలు కొండలపైకి చాలా నెమ్మదిగా వెళతాయి', ''),
(528, 528, ' నంబర్ ప్లేట్ శుభ్రంగా ఉందొ లేదో చూడాలి', ' టైర్ కండిషన్, టైర్ల గాలి, చక్రాల నట్లు గట్టిగా బిగించబడి ఉన్నాయో లేదో పరిశీలించుకోవాలి', ' ఇంధనం, కూలంట్ లేదా ఆయిల్ లీక్ అవుతుందేమో చెక్ చేసుకోవాలి', ' పైవన్నీ', ''),
(529, 529, 'ఇండికేటర్లు, లైట్లు సరిగా పనిచేయకపోవడం', ' సీట్ బెల్టులు ఉపయోగించకపోవడం', 'పైవి రెండూ', 'పైవి ఏవీకావు', ''),
(530, 530, 'రోడ్డు యొక్క పరిస్థితి మరియు వాతావరణం', ' ట్రాఫిక్ పరిస్థితులు మరియు వాహనం యొక్క పరిస్థితి', ' మీ యొక్క పరిజ్ఞానం మరియు ఏకాగ్రత', 'పైవన్నీ', ''),
(531, 531, ' చేతి సిగ్నల్స్ ఇవ్వాలి', ' మీ వాహనం స్పీడ్ తగ్గించాలి', 'హెడ్ లైట్స్ వాడాలి', ' మీ వాహనం స్పీయేడు పెంచాలి', ''),
(532, 532, ' ప్రయాణికులది', 'వాహనపు మెకానిక్ ది', ' వాహపు డ్రైవర్ ది', ' పైవన్నీ', ''),
(533, 533, ' ప్రమాదాన్ని తెలిపే హజార్డ్ లైట్లను వెలిగించి ఉంచాలి', ' సైడ్ లైట్లను వేసి ఉంచాలి', ' రాళ్లను ఇటుకలను మీ బండి చుట్టు పెట్టాలి', 'పైవి ఏవీకావు', ''),
(534, 534, 'సురక్షిత ప్రదేశంలో ఆగినప్పుడు', ' మెల్లగా ప్రయాణం చేసేటప్పుడు', ' వాహనంపై ఉన్నప్పుడు', ' ట్రాఫిక్ తక్కువగా ఉన్నప్పుడు', ''),
(535, 535, ' సైక్లిస్ట్', ' పాదచారులు', ' మోటార్ సైక్లిస్ట్', ' పైవన్నీ', ''),
(536, 536, ' రోడ్డు మీద ఒక పక్కకి స్టీరింగ్ తిప్పాలి', 'సున్నితంగా వేగాన్ని పెంచాలి', 'వేగం తగ్గించడానికి బ్రేకును స్థిరంగా ఉపయోగించాలి', 'ఆక్సిలేటర్ ను వదిలేయాలి', ''),
(537, 537, ' బాగా కనపడేంత వరకు వెనకకు వెళ్ళాలి', ' ఎక్కువ కాంతితో హెడ్ లైట్స్ వెలిగించాలి', ' లారీ దగ్గరగా, బురదను దూరంగా వెళ్ళాలి', ' వేగం పెంచి త్వరగా ఓవర్ టేక్ చెయ్యాలి', ''),
(538, 538, ' ఒక వేళా అది తన దిశను మార్చుకోవచ్చు', 'ఒక వేళ దాని ఫాగ్ లైట్లు మీకు ఇబ్బంది కలిగించవచ్చు', 'ఒక వేళా అది అకస్మాత్తుగా ఆగిపోవచ్చు', ' ఒక వేళా దాని బ్రేక్ లైట్లు మీకు ఇబ్బంది కలిగించవచ్చు', ''),
(539, 539, 'కాలిన గాయాలను నీతితో తడపాలి', 'కాలిన గాయాలకు ఏదైనా అతుక్కొని ఉంటె తొలగించాలి', ' ఏమన్నా బొబ్బలుంటే వాటిని చిదిమేయాలి', ' లేపనాలు (లోషన్లు) పూయాలి', ''),
(540, 540, ' మనుషులు', ' మొక్కలు', 'జంతువులు', ' అన్ని సమాధానాలు సరైనవే', ''),
(541, 541, ' వాహనం కుడి వైపుకు లాగేస్తుంది', 'వాహనం ఎడమ వైపుకు లాగేస్తుంది', ' స్టీరింగ్ అటూ ఇటూ ఊగిపోతోంది', ' ఏదీ సరైన సమాధానం కాదు', ''),
(542, 542, ' డ్రైవ్ చేసేటప్పుడు కాలిని క్లచ్ పై ఉంచడం', 'గేర్లు మార్చేటప్పుడు క్లచ్ నొక్కకపోవడం', ' డ్రైవ్ చేసేటప్పుడు క్లచ్ పై కాలు ఉంచకపోవడం', 'ఏదీ సరైన సమాధానం కాదు', ''),
(543, 543, ' ఇంజన్ ఆయిల్ తక్కువగా ఉండటం వలన', 'కూలంట్ తక్కువగా ఉండటం వలన', ' చక్రాల బ్యాలెన్స్ సరిగ్గా లేనందువలన', 'టైర్లు అరిగిపోయి, నునుపు తేలినప్పుడు', ''),
(544, 544, ' డ్రైవింగ్ నేర్చుకునే సందర్భంలో', ' ఎట్టి పరిస్థితుల్లోనూ ఇవ్వకూడదు', 'గుర్తింపు రుజువు చేసుకునేందుకు మాత్రమే ఇవ్వాలి', 'ఎదుటి వ్యక్తి తనకు బాగా తెలిసిన వాడే అయినప్పుడు', ''),
(545, 545, 'మీరెవరో వారికి తెలియ చెప్పి అక్కడ నుంచి వెళ్ళిపోవాలి', ' గాయపడ్డ వ్యక్తికి సాయం చేసి అంబులెన్స్ రప్పించాలి', 'గాయపడ్డ వారికి సాయం చేసి, మీ వివరాలు చెప్పి, ఆ తరువాత పోలీసులకు తెలియచేయాలి', 'ఏదీ సరైన సమాధానం కాదు', ''),
(546, 546, ' ఆలా అడ్వేర్టైజ్ చేయడం చట్ట విరుద్ధం', ' దాని వాళ్ళ డ్రైవర్ కి సరిగా కనిపించదు', ' ఇతర డ్రైవర్లకు మీరు కనిపించకుండా ఉంటారు', 'ఏదీ సరైన సమాధానం కాదు', ''),
(547, 547, ' అత్యవసర పరిస్తితుల్లో తప్పనిసరైతే మాత్రమే డ్రైవ్ చేయాలి', ' సరైన లైసెన్స్ ఉన్న వ్యక్తి తోడుంటేనే డ్రైవ్ చేయాలి', 'ఎట్టి పరిస్థితుల్లోనూ డ్రైవ్ చేయకూడదు', ' ఏదీ సరైన సమాధానం కాదు', ''),
(548, 548, ' 10 రోజులు', '20 రోజులు', '30 రోజులు', ' 25 రోజులు', ''),
(549, 549, 'ఒక్కో తరహా వాహనం కోసం ఒక్కటి చొప్పున మూడుకు మించకుండా', 'ఒకే ఒక్క లైసెన్సు', ' ఎన్ని కావాలంటే అన్ని లైసెన్సులుండవచ్చు. అయితే ఒక లైసెన్సు ఒక తరహా వాహనానికి మాత్రమే పరిమితమై ఉండాలి', 'ఏదీ సరైన సమాధానం కాదు', ''),
(550, 550, ' తీసుకున్న వాడే పూర్తిగా భాద్యుడు కాబట్టి మన తప్పేం ఉండదు', 'ఇది తీవ్రమైన నేరం', 'వాహనం ఆక్సిడెంట్ చేరినప్పుడే నేరం', 'ఏదీ సరైన సమాధానం కాదు', ''),
(551, 551, ' కేవలం అత్యవసర పరిస్థితుల్లోనే దీనికి అనుమతి ఉంటుంది', 'ఇది చట్టరీత్యా నేరం', ' నడిపితే అధికారులు తీవ్రంగా హెచ్చరిస్తారు', 'ఏదీ సరైన సమాధానం కాదు', ''),
(552, 552, ' కేవలం అత్యవసర పరిస్థితుల్లోనే దీనికి అనుమతి ఉంటుంది', 'ఇది శబ్ద కాలుష్యం కలిగిస్తుంది కాబట్టి చట్టరీత్యా నేరం', ' ఆలా చేస్తే అధికారులు తీవ్రంగా హెచ్చరిస్తారు', 'ఏదీ సరైన సమాధానం కాదు', ''),
(553, 553, ' ప్రాణాన్ని కాపాడటం', 'త్వరగా కోలుకునేలా చేయడం', ' బాధితుడి పరిస్థితి మరింత దిగజారకుండా చూడటం', ' అన్ని సమాధానాలు సరైనవే', ''),
(554, 554, 'చికాకు కలుగుతుంది', ' విసుగు కలుగుతుంది', ' కోపం వస్తుంది', ' అన్ని సమాధానాలు సరైనవే', ''),
(555, 555, ' నిర్ణయం తీసుకునే సామర్థ్యం', ' స్వనియంత్రణ', ' విచక్షణ శక్తి', ' అన్ని సమాధానాలు సరైనవే', ''),
(556, 556, ' ఉగ్ర ప్రవర్తన', 'నిర్ణయం తీసుకోలేక పోవడం', ' హింసాత్మక ధోరణి', ' అన్ని సమాధానాలు సరైనవే', ''),
(557, 557, ' చురుకుదనం తగ్గుతుంది', ' చూపు మందగిస్తుంది', ' నిర్ణయం తీసుకునే సామర్థ్యం తగ్గుతుంది', ' అన్ని సమాధానాలు సరైనవే', ''),
(558, 558, ' స్టాప్పింగ్ డిఫెన్స్ పై ఎలాంటి ప్రభావం ఉండదు', ' స్పీడ్ పెరిగే కొద్దీ స్టాప్పింగ్ డిఫెన్స్ తగ్గుతుంది', ' స్పీడ్ పెరిగే కొద్దీ స్టాపింగ్ డిఫెన్స్ పెరుగుతుంది', 'పైవి ఏవి కావు', ''),
(559, 559, ' గేర్ న్యుట్రాల్లో ఉండాలి', ' హ్యాండ్ బ్రేక్ వేసి ఉండాలి', ' క్లచ్ పెడల్ నొక్కి ఉండాలి', ' అన్ని సమాధానాలు సరైనవే', ''),
(560, 560, 'పోలీస్ వాహనాలు', ' బస్సులు', ' అత్యవసర సేవల వాహనాలు', 'ద్విచక్ర వాహనాలు', ''),
(561, 561, 'రాత్రి వేళల్లో', 'పార్కింగ్ లైట్లకు బదులుగా', ' హైవేలలో', ' పొగ మంచు దట్టంగా ఉన్నప్పుడు', ''),
(562, 562, 'పాదచారుల కోసం', ' అత్యవసర సేవల వాహనాల కోసం', ' నెమ్మదిగా వెళ్లే వాహనాల కోసం', ' వాహనాలను నిలిపేదుకు', ''),
(563, 563, ' బస్సుల్లో అనుమతి ఉంది', ' ఎలాంటి వాహనాల్లోనైనా ఇలా ఎక్కి దిగడం నిషేధం', 'బస్సుల్లో ఇలా ఎక్కి దిగడం నిషేధం', ' యాత్రికుల వాహనంలో దీనికి అనుమతి ఉంది', ''),
(564, 564, ' రద్దీ తక్కువగా ఉన్నప్పుడు అనుమతి ఉంటుంది', ' ఇది చట్ట విరుద్ధం', 'కొన్ని చోట్ల దీనికి అనుమతి ఉంది', ' అన్ని సమాధానాలు సరైనవే', ''),
(565, 565, ' ఇది చట్ట విరుద్ధం', ' దీనికి చట్టం అనుమతిస్తుంది', 'కొన్ని చోట్ల దీనికి అనుమతి ఉంది', ' అన్ని సమాధానాలు సరైనవే', ''),
(566, 566, ' ఇంధనం పొదుపు అవుతుంది', ' ప్రమాదాలు ఎదురైనప్పుడు ప్రతిస్పందించడానికి తగినంత సమయం ఉండదు', ' ప్రయాణానికి తక్కువ సమయం పడుతుంది', 'మీ ఇంజనుకు నష్టం తక్కువగా ఉంటుంది', ''),
(567, 567, 'తక్కువ ట్రాఫిక్ ఉన్న రోడ్డు భాగం ఉపయోగించండి', 'దాటేటప్పుడు తప్ప రోడ్డుకు ఎడమవైపు భాగంలో ఉండండి', ' రద్దీ లేకుండా స్పష్టంగా ఉన్న వైపు ఓవర్ టేక్ చేయండి', 'ఇరుకుగా ఉండకుండా ఉండేందుకు గంటకు 50 మైళ్ళ వేగంతో ప్రయాణించండి  ', ''),
(568, 568, 'వాహనాల నిర్వహణ (మైంటెనెన్సు) సరిగా లేకపోవడం', ' వాహనాలపై అత్యధిక బరువు వేయడం', ' ట్రాఫిక్ జాములు', ' అన్ని సమాధానాలు సరైనవే', ''),
(569, 569, ' మీరు వెళుతున్న వేగం', 'మీ వాహనపు టైర్లు', ' వాతావరణం', ' అన్ని సమాధానాలు సరైనవే', ''),
(570, 570, ' ఎక్కువగా ప్రజా రవాణా వ్యవస్థనే వాడాలి', ' అవకాశం వచ్చినప్పుడు ఎవరికరుణైనా షేర్ చేసుకోవాలి', 'కొద్దిపాటి దూరాలు ప్రయాణించినప్పుడు నడిచి లేదా సైకిల్ పై వెళ్ళాలి', ' అన్ని సమాధానాలు సరైనవే', ''),
