(663, 663, ' ఎప్పుడు దాటవలసివస్తే అప్పుడు సిగ్నల్ ఇచ్చి ఆ గీతను దాటవచ్చు', ' ఓవర్ టేకింగ్ నిషేధం', 'ఎటువంటి పరిస్థితులలోను గీత దాటి వెళ్ళకూడదు', 'పైవేవీ కావు', ''),
(664, 664, 'క్రాస్ చేయడం సురక్షితం అని మీరు భావించినప్పుడు', ' ఎడమ పక్క వాహనాలు జాగ్రత్తగా గీత దాటవచ్చును', ' ఎట్టి పరిస్థితులలోను దాటకూడదు', ' పైవన్నీ', ''),
(665, 665, ' సమాంతర రేఖకు ప్రక్కన ఉన్న వాహనములు ఓవర్ టేక్ చేయుటకు అనుమతించబడినది', ' విరిగిన గీతకు ప్రక్కన వున్నా వాహనాలను ఓవర్ టేక్ చేయుటకు అనుమతించబడినది', 'ఓవర్ టేక్ రెండు వైపులా చేయవచ్చును', 'పైవన్నీ', ''),
(666, 666, 'ఎట్టి పరిస్థితులలోను ఈ గీతాల వెంబడి ఓవర్ టేక్ చేయడం \'యు\' టర్న్ తీసుకోవడం అనుమతించరు', 'వన్ వే రోడ్డు', 'క్రాస్ చేయడం సురక్షితం అని మీరు భావించినప్పుడు', ' పైవేవీ కావు', ''),
