(466, 'మీ డ్రైవింగును ప్రభావితం చేసే మందులు మీరు వాడుతున్నట్లైతే ఏం చేయాలి?', 1, '', 2, '2019-01-19 13:19:05', 1),
(467, 'మీరు ప్రయాణం ప్రారంభించే ముందు ఎవరితోనో వాదులాడి వస్తున్నారు.  అందువల్ల మీకు చాలా కోపంగా ఉంది. ఆసమయంలో మీరేం చేస్తారు?', 4, '', 2, '2019-01-19 13:21:36', 1),
(468, 'ఇంకో డ్రైవర్ ప్రవర్తన మీకు ఇబ్బంది కలిగించింది.  కిందివిధంగా చేస్తే మీకు సహాయకారిగా ఉంటుంది.', 1, '', 2, '2019-01-19 13:24:19', 1),
(469, 'భారత దేశంలో ఏ రాష్ట్రంలో తీసుకున్న డ్రైవింగ్ లైసెన్స్ అయినా', 1, '', 2, '2019-01-19 13:26:56', 1),
(470, 'హారన్ ఎప్పుడు ఉపయోగించాలి?', 1, '', 2, '2019-01-19 13:29:14', 1),
(471, 'కొత్త వాహనాన్ని నడిపించే ముందు డ్రైవర్ ఏంచేయాలి?', 1, '', 2, '2019-01-19 14:52:00', 1),
(472, 'మద్యం మొట్ట మొదటిసారిగా దీనిపై ప్రభావం చూపుతుంది?', 4, '', 2, '2019-01-19 14:52:52', 1),
(473, 'ఒక పబ్ లో భోజనానికి ఆహ్వానం అందింది. సాయంత్రం ఇంటికి వాహనాన్ని నడుపుకుంటూ వెళ్లాల్సి ఉంది. మీరేం చేయాలి?', 2, '', 2, '2019-01-19 14:54:03', 1),
(474, 'ఒక పార్టీలో మద్యం సేవించిన డ్రైవర్ కు మీరిచ్చే సలహా ఏంటి?', 3, '', 2, '2019-01-19 14:55:59', 1),
(475, 'మద్యం కాకుండా మిమ్మల్ని అధికంగా ప్రభావితం చేసే మరో విషయమేమిటి?', 4, '', 2, '2019-01-19 14:56:57', 1),
(476, 'మీ వాహనం యొక్క డోరును తెరిచేటప్పుడు మీరు ఎటువంటి జాగ్రత్తను తీసుకోవాలి?', 4, '', 2, '2019-01-19 14:58:48', 1),
(477, 'అత్యవసర వాహనాల సైరన్ విన్నప్పుడు ఏం చేయాలి?', 4, '', 2, '2019-01-19 14:59:53', 1),
(478, 'ఇతర వాహనాలను హెచ్చరించాలి', 2, '', 2, '2019-01-19 15:06:28', 1),
(479, 'క్రింద పేర్కొన్న ఏ వైఖరి మిమ్మల్ని సురక్షితమైన డ్రైవరుగా చేస్తుంది?', 1, '', 2, '2019-01-19 15:07:53', 1),
(480, 'హైవే పై వెళ్తుండగా మీ వాహనం ఉన్నట్టుండి పాడై ఆగిపోయింది. అప్పుడు మీరేం చేయాలి?', 1, '', 2, '2019-01-19 15:27:38', 1),
(481, 'ఈ క్రింది వాటిలో దేనిని మీ వాహనంలో ఉంచుకోకూడదు?', 3, '', 2, '2019-01-19 15:37:00', 1),
(482, 'ఈ క్రింది వానిలో ఏది సరైనది', 1, '', 2, '2019-01-19 15:37:44', 1),
(483, '\r\nమరమ్మత్తుకు గురైన వాహనాన్ని తీసుకెళ్తున్నప్పుడు పాటించాల్సిన గరిష్ట వేగం ఎంత?\r\n', 3, '', 2, '2019-01-19 15:54:31', 1),
(484, '\r\nఈ క్రింది వానిలో ఏది సరైనది\r\n', 4, '', 2, '2019-01-19 15:56:16', 1),
(485, '\r\nనీవు కొంత మంది పనివారు పనిచేయుచున్న ప్రదేశానికి చేరుకున్నావు, నీ వేగం ఇంతకు మించి ఎక్కువ ఉండరాదు\r\n', 1, '', 2, '2019-01-19 15:57:05', 1),
(486, '\r\nమీటింగ్స్, మార్చ్ లు  జరుగుతున్నా ప్రాంతాలలో నీ కారు యొక్క గరిష్ట వేగా పరిమితి ఎంత\r\n', 2, '', 2, '2019-01-19 15:57:56', 1),
(487, '\r\nసరుకు రవాణా వాహనంలో ప్రయాణికులను తీసుకెళ్లవచ్చా\r\n', 4, '', 2, '2019-01-19 15:58:46', 1),
(488, '\r\nఈ క్రింది వాటిలో వాహనంతో పాటు తీసుకుని వెళ్లనవసరం లేని డాక్యూమెంట్లు ఏవి?\r\n', 4, '', 2, '2019-01-19 15:59:38', 1),
(489, '\r\nఈ క్రిందివారిలో ఎవరికీ నీ వాహనం యొక్క కాగితాలను చూపించమని అడిగే హక్కు ఉంది?\r\n', 4, '', 2, '2019-01-19 16:00:26', 1),
(490, '\r\nరోడ్డుపై ద్విచక్ర వాహనం యొక్క గరిష్ట వేగా పరిమితి ఎంత?\r\n', 3, '', 2, '2019-01-19 16:01:12', 1),
(491, '\r\nగేర్లను ఉపయోగించి వాహనాన్ని ఆగేలా చేయడం ఎలా?\r\n', 3, '', 2, '2019-01-19 16:01:59', 1),
(492, '\r\nక్రింద పేర్కొన్న ఏ కారణం వల్ల పూర్తిగా వాహనం నడపడంపై దృష్టిని సారించడం సాధ్యపడదు?\r\n', 4, '', 2, '2019-01-19 16:02:47', 1),
(493, '\r\nమోటార్ వేపై ప్రయాణించే సమయంలో మీకు నిద్ర వస్తున్నట్లు అనిపిస్తే ఏంచేయాలి?\r\n', 4, '', 2, '2019-01-19 16:03:32', 1),
(494, '\r\nఈ క్రింది వాటిలో ఏవి ఖచ్చితంగా మంచి పరిస్థిలో ఉంది తీరాలని చట్టం చెబుతుంది?\r\n', 4, '', 2, '2019-01-19 16:04:20', 1),
(495, '\r\n13 సంవత్సరాల వయస్సున్న ఇద్దరు పిల్లలు, వారి తల్లిదండ్రులు మీ కారులో ప్రయాణిస్తున్నారు.  పిల్లలు సీట్ బెల్ట్ ధరించేలా చేయాల్సిన బాధ్యత ఎవరిదీ?\r\n', 2, '', 2, '2019-01-19 16:05:00', 1),
(496, '\r\nశబ్ద కాలుష్యం ప్రభావం ఎలా ఉంటుంది?\r\n', 4, '', 2, '2019-01-19 16:07:16', 1),
(497, '\r\nఎవరైనా డ్రైవర్ మీకు చికాకు తెప్పించేలా వ్యవహరిస్తే ఏం చేయాలి?\r\n', 1, '', 2, '2019-01-19 16:08:04', 1),
(498, '\r\nఅనుభవం లేని డ్రైవర్లతో మీరెలా స్పందించాలి?\r\n', 2, '', 2, '2019-01-19 16:08:44', 1),
(499, '\r\nమీ హెడ్ లైట్లను ఇతర వాహన చోదకులపై ఎందుకు ఫ్లాష్ చెయ్యాలి?\r\n', 4, '', 2, '2019-01-19 16:09:33', 1),
(500, '\r\nడ్రైవ్ చేస్తున్నపుడు క్లచ్ పెడల్ ను నొక్కడం గాని, న్యూట్రల్ లో చాలా దూరం వెళ్లడం కానీ చేసినప్పుడు\r\n', 3, '', 2, '2019-01-19 16:12:05', 1),
(501, '\r\nమీ వాహన వేగాన్ని నియంత్రించేందుకు గేర్లను ఎలా వాడాలి?\r\n', 1, '', 2, '2019-01-19 16:12:58', 1),
(502, '\r\nమీరు ఒక నిటారైనా కొండా నుండి కిందకు దిగుతున్నారు.  అప్పుడు క్లచ్ ను అదిమిపట్టడం లేదా ఎక్కువ సేపు న్యూట్రల్ లో వాహనాన్ని నడపడం ఎందుకు ప్రమాదకరం?\r\n', 2, '', 2, '2019-01-19 16:13:40', 1),
(503, '\r\nభారీ వర్షంలో ప్రయాణిస్తున్నప్పుడు బ్రేక్ వేసిన తర్వాత మీ వాహనం ఆగేదూరం?\r\n', 1, '', 2, '2019-01-19 16:15:24', 1),
(504, 'పబ్లిక్ మార్గాలను ఉపయోగించడానికి చట్ట ప్రకారం మీరు చేయాల్సిన కనీస భీమా ఏది?', 3, '', 2, '2019-01-19 16:16:10', 1),
(505, '\r\nఒక సెకండ్ హ్యాండ్ వాహనాన్ని కొన్నారు.  ఆ విషయాన్ని సంబంధిత అధికారులకు ఎప్పటిలోగా తెలియజేయాలి?\r\n', 1, '', 2, '2019-01-19 16:16:54', 1),
(506, '\r\nప్రమాదం జరిగిన ఒక ప్రదేశానికి ప్రప్రధమంగా మీరే వెళ్లారు.  ఆ సందర్భంలో మీరు క్రింద పేర్కొన్న ఏయే పనులు చేయాలి?\r\n', 4, '', 2, '2019-01-19 16:17:46', 1),
(507, '\r\nఅప్పుడే ఒక ప్రమాదం జరిగింది. గాయపడిన వ్యక్తి రోడ్డుపై పది ఉన్నాడు.  ఆ పరిస్థితిలో మొట్టమొదట మీరు చేయాల్సిందేమిటి?\r\n', 2, '', 2, '2019-01-19 16:18:36', 1),
(508, 'ఓ రోడ్డు ప్రమాదాన్ని  సహాయం చేసేందుకు మీరు ఆగారు. అప్పుడు ఈ క్రింది వాటిలో మీరేం చేయాలి?', 4, '', 2, '2019-01-19 16:19:21', 1),
(509, '\r\nపగటి పూత మెరిసే వెలుతురులో ఎదుటి వాహనపు ఇండికేటర్లను గుర్తించడం కష్టం. అప్పుడేం చేయాలి?\r\n', 1, '', 2, '2019-01-19 16:20:16', 1),
(510, '\r\nవాహనం నడిపేటప్పుడు ఎల్లప్పుడూ మీతో ఉంచుకోవాల్సిన డాకుమెంట్స్ ఏవి?\r\n', 3, '', 2, '2019-01-19 16:21:03', 1),
(511, '\r\nలెర్నర్ లైసెన్స్ ఎంత కాలం చెల్లుతుంది?\r\n', 1, '', 2, '2019-01-19 16:21:49', 1),
(512, '\r\nపర్మనెంట్ డ్రైవింగ్ లైసెన్సును రెన్యూవల్ చేయడానికి ఉండే గ్రేస్ పీరియడ్ ఎంత?\r\n', 2, '', 2, '2019-01-19 16:22:55', 1),
(513, '\r\nఎటువంటి పరిథితులలో మీ యొక్క కారుని సీజ్ చేయవచ్చును?\r\n', 1, '', 2, '2019-01-19 16:23:48', 1),
(514, '\r\nఆల్కహాల్ డ్రైవింగ్ ను ఎలా ప్రభావితం చేస్తుంది?\r\n', 2, '', 2, '2019-01-19 16:24:58', 1),
(515, '\r\nనియంత్రణలో లేని పాదచారులు (పెడస్ట్రియన్స్) క్రాసింగ్ దాటేటప్పుడు  ఎలాంటి జాగ్రత్తలు తీసుకోవాలని చట్టం సూచిస్తుంది?\r\n', 3, '', 2, '2019-01-19 16:25:42', 1),
(516, '\r\nరాత్రి వేళల్లో ఇతర వాహనాల హెడ్ లైట్ల కాంతివల్ల కళ్ళు చెదిరినప్పుడు మీరేం చేయాలి?\r\n', 2, '', 2, '2019-01-19 16:26:26', 1),
(517, 'కవర్ నోట్ అనేది దేనికి ముందు జారీ చేసే పత్రం', 3, '', 2, '2019-01-19 16:27:15', 1),
(518, '\r\nమీ వాహనంలో మంటలు రేగినట్లు వాసన పసిగట్టిన, లేదా కనిపించినా మీరేం చేయాలి?\r\n', 1, '', 2, '2019-01-19 16:28:04', 1),
(519, '\r\nడ్రైవ్ చేసేటప్పుడు అవసరమయ్యే సమయం కన్నా ఎక్కువ సేపు క్లచ్ మీద కాలు ఉంచకూడదు. ఎందుకు?\r\n', 1, '', 2, '2019-01-19 16:28:53', 1),
(520, '\r\nచోక్ ఏ పనిని చేస్తుంది?\r\n', 1, '', 2, '2019-01-19 16:29:47', 1),
(521, '\r\nమీకు థర్డ్ పార్టీ ఇన్సూరెన్సు ఉంది. అది వీటిని కవర్ చేస్తుంది?\r\n', 4, '', 2, '2019-01-19 16:30:28', 1),
(522, '\r\nభారీ వర్షన్ తర్వాత మీరు బ్రేక్ వేసినప్పుడు వాహనం ఎక్కువ దూరం వెళ్లి ఆగుతుంది. ఎందుకు?\r\n', 3, '', 2, '2019-01-19 16:32:02', 1),
(523, '\r\nమీ వాహనంలో సరుకులు తీసుకువెళ్తున్నప్పుడు ఎలాంటి జాగ్రత్తలు తీసుకోవాలి?\r\n', 1, '', 2, '2019-01-19 16:32:48', 1),
(524, '\r\nపాదచారి చేతిలో తెల్లని కర్ర దేనికి గుర్తు?\r\n', 4, '', 2, '2019-01-19 16:33:33', 1),
(525, '\r\nరోడ్డు పని జరుగుతున్నా ప్రాంతంలోకి ప్రవేశించారు. అక్కడ తాత్కాలిక గరిష్ట వేగా పరిమితి ఉన్న చిహ్నాన్ని గమనిస్తే ఎం చేయాలి?\r\n', 2, '', 2, '2019-01-19 16:34:19', 1),
(526, '\r\nవాహనం పైభాగంలో తీసుకు వెళ్లే సామాను విషయంలో తీసుకోవలసిన జాగ్రత్తలు\r\n', 1, '', 2, '2019-01-19 16:35:10', 1),
(527, '\r\nకారును దాటడంకంటే లారీని ఓవర్ టేక్ చేయడం ప్రమాదకరం. ఎందుకని?\r\n', 1, '', 2, '2019-01-19 16:35:52', 1),
(528, '\r\nవాహనాన్ని స్టార్ట్ చేసేముందు డ్రైవర్ ఎం పరిశీలించాలి?\r\n', 4, '', 2, '2019-01-19 16:36:35', 1),
(529, '\r\nకార్ల డ్రైవింగ్ లో ఏది చట్ట వ్యతిరేకం?\r\n', 3, '', 2, '2019-01-19 16:37:23', 1),
(530, '\r\nవాహనాన్ని నడిపేటప్పుడు ప్రతి సారి ఈ క్రింది వానిని దృష్టిలో పెట్టుకోవాలి\r\n', 4, '', 2, '2019-01-19 16:38:14', 1),
(531, '\r\nమీ వాహనాన్ని వేరొక వాహనం ఓవర్ టేక్ చేసినప్పుడు మీరు ఇవి చేయకూడదు\r\n', 4, '', 2, '2019-01-19 16:39:04', 1),
(532, '\r\nవాహనంలో బరువు ఎక్కువ కాకుండా చూడాల్సిన బాధ్యత ఎవరిది?\r\n', 3, '', 2, '2019-01-19 16:39:49', 1),
(533, '\r\nపొగ మంచు కప్పి ఉన్న రోడ్డుపై మీ వాహనాన్ని పార్క్ చేయాల్సి వస్తే ఏంచేయాలి?\r\n', 2, '', 2, '2019-01-19 16:40:39', 1),
(534, '\r\nమీ మొబైల్ ఫోన్ ని ఈ క్రింది వాటిలో ఏ సమయంలో వాడవచ్చు?\r\n', 1, '', 2, '2019-01-19 16:41:19', 1),
(535, '\r\nవేగంగా వెళుతున్న భారీ వాహనాలు చేసే గందరగోళం వలన క్రింది వారిలో ఎవరికీ ప్రమాదం?\r\n', 4, '', 2, '2019-01-19 16:42:08', 1),
(536, '\r\nభారీ వర్షాలొ మీరు ప్రయాణం చేస్తున్నారు.  మీ స్టీరింగ్ అకస్మాత్తుగా తేలికగా అనిపించింది. అప్పుడు మీరు\r\n', 4, '', 2, '2019-01-19 16:45:10', 1),
(537, '\r\nమీరు ఒక పొడవైన భారీ వాహనాన్ని వర్షం పడుతున్నప్పుడు అనుసరించుచున్నారు, భారీ వాహనం టైర్లు వెదజల్లుతున్న బురద వలన మీకు రోడ్డు కనపడుటలేదు, ఎం చేయాలి\r\n', 1, '', 2, '2019-01-19 16:45:51', 1),
(538, '\r\nమంచులో మీరు వాహనం నడుపుతున్నారు. ముందున్న వాహనంకంటే మీరుందుకు బాగా వెనక్కి ఉండాలి?\r\n', 3, '', 2, '2019-01-19 16:46:40', 1),
(539, 'రోడ్డు ప్రమాదం జరిగిన చోటుకు మీరు వెళ్లారు.  అక్కడ ఒకరు కాలిన గాయాలతో బాధపడుతున్నారు అప్పుడు మీరేం చేస్తారు?', 1, '', 2, '2019-01-19 16:50:43', 1),
(540, '\r\nవాయు కాలుష్య ప్రభావం ఈ క్రింద పేర్కొన్న వారిలో ఎవరిపై ఉంటుంది?\r\n', 4, '', 2, '2019-01-19 16:51:23', 1),
(541, '\r\nబ్యాలెన్స్ లేని చక్రాలు కారుపై ఇలాంటి ప్రభావం చూపుతాయి?\r\n', 3, '', 2, '2019-01-19 16:52:09', 1),
(542, 'క్లచ్ రైడింగ్ అంటే ఏమిటి?', 1, '', 2, '2019-01-19 16:52:57', 1),
(543, '\r\nవాహనం నడుపుతున్నప్పుడు స్టీరింగులో ప్రకంపనలు (వైబ్రేషన్స్) ఎందువల్ల కలుగుతాయి?\r\n', 3, '', 2, '2019-01-19 16:53:49', 1),
(544, '\r\nడ్రైవర్ తన డ్రైవింగ్ లైసెన్సును ఇంకొక వ్యక్తికీ ఏయే పరిస్థితుల్లో ఇవ్వవచ్చు?\r\n', 3, '', 2, '2019-01-19 16:54:37', 1),
(545, '\r\nమీ వాహనం ఒక పాదచారిని ఢీకొంటే మీరేం చేయాలి?\r\n', 3, '', 2, '2019-01-19 16:55:20', 1),
(546, '\r\nవిండ్ షీల్డ్ పై స్టిక్కర్లు, పోస్టర్లు ఇతర అనధికారిక వస్తువులు అతికించవద్దు, ఎందుకు?\r\n', 2, '', 2, '2019-01-19 16:56:06', 1),
(547, '\r\nడ్రైవింగ్ లైసెన్స్ రద్దయినా, సస్పెండ్ అయినా అలంటి డ్రైవర్ ఎం చేయాలి?\r\n', 3, '', 2, '2019-01-19 16:56:49', 1),
(548, '\r\nడ్రైవింగ్ లైసెన్స్ గడువు పూర్తయ్యాక, రెన్యూవల్ చేసుకోవడానికి అపరాధ రుసుము లేకుండా ఎన్ని రోజులలో చేయించుకొనవచ్చును?\r\n', 3, '', 2, '2019-01-19 16:57:31', 1),
(549, '\r\nఒక వ్యక్తి ఎన్ని లైసెన్సులు కలిగి ఉండవచ్చు?\r\n', 2, '', 2, '2019-01-19 16:58:25', 1),
(550, 'సరైన లైసెన్సు లేని వ్యక్తికి నడిపేందుకు మన వాహనాన్ని ఇవ్వడం సరైనదేనా?', 2, '', 2, '2019-01-19 16:59:10', 1),
(551, '\r\nచట్టం నిర్దేశించిన పరిమితుల కన్నా ఎక్కువ కాలుష్య స్థాయి ఉన్న వాహనం నడపవచ్చా?\r\n', 2, '', 2, '2019-01-19 16:59:57', 1),
(552, '\r\nవాహనానికి మల్టీ టోన్ ఉన్న హారన్ ను అమర్చవచ్చా?\r\n', 2, '', 2, '2019-01-19 17:01:21', 1),
(553, '\r\nప్రథమ చికిత్స లక్ష్యాలు ఏమిటి?\r\n', 4, '', 2, '2019-01-19 17:02:04', 1),
(554, '\r\nఆల్కహాల్ వాళ్ళ ఈ క్రింది లక్షణాలు కనిపిస్తాయి\r\n', 4, '', 2, '2019-01-19 17:03:06', 1),
(555, '\r\nమద్యం ఈ క్రింద పేర్కొన్న వాటిల్లో దేనిని ప్రభావితం చేస్తుంది?\r\n', 4, '', 2, '2019-01-19 17:03:57', 1),
(556, '\r\nఆల్కహాలిజం వాళ్ళ కలిగే ఫలితాలు\r\n', 4, '', 2, '2019-01-19 17:04:49', 1),
(557, '\r\nఆల్కహాల్ ఈ క్రింది సామర్థ్యాలను తగ్గిస్తుంది\r\n', 4, '', 2, '2019-01-19 17:06:52', 1),
(558, '\r\nనడిపే వేగం పెరిగితే వాహనం నిలిపేందుకు అవసరమైన దూరంపై ఎలాంటి ప్రభావం పడుతుంది?\r\n', 3, '', 2, '2019-01-19 17:07:45', 1),
(559, '\r\nస్టార్ట్ చేసే సమయంలో ఈ దిగువన సూచించిన వాటిలో ఏ పనులు చేయాలి?\r\n', 4, '', 2, '2019-01-19 17:08:31', 1),
(560, '\r\nఏ వాహనాలకు ముందుగా ప్రాధాన్యత ఇవ్వాలి?\r\n', 3, '', 2, '2019-01-19 17:09:15', 1),
(561, 'ఫాగ్ ల్యంపులను ఏ సందర్భాల్లో ఉపయోగించాలి?', 4, '', 2, '2019-01-19 17:10:00', 1),
(562, '\r\nజీబ్రా క్రాసింగ్ లు ఎవరి కొనసా ఏర్పాటయ్యాయి?\r\n', 1, '', 2, '2019-01-19 17:10:44', 1),
(563, '\r\nవాహనాలు కదులుతున్నప్పుడు ఎక్కడం లేదా దిగడం\r\n', 2, '', 2, '2019-01-19 17:11:30', 1),
(564, '\r\nద్విచక్ర వాహనాల్లో ఇద్దరి కన్నా ఎక్కువ మంది ప్రయాణించడం\r\n', 2, '', 2, '2019-01-19 17:12:16', 1),
(565, '\r\nరిజిస్ట్రేషన్ లేని వాహనాలు బహిరంగ ప్రదేశాల్లో ఉపయోగించడం\r\n', 1, '', 2, '2019-01-19 17:13:12', 1),
(566, '\r\nఅత్యంత వేగంగా వెళ్లడంవల్ల\r\n', 2, '', 2, '2019-01-19 17:14:01', 1),
(567, '\r\nహైవే మీద ఉన్నప్పుడు మీ ప్రాథమిక కర్తవ్యం ఏమిటి?\r\n', 2, '', 2, '2019-01-19 17:14:46', 1),
(568, '\r\nవాహన కాలుష్యానికి ప్రధాన కారణం ఏమిటి?\r\n', 4, '', 2, '2019-01-19 17:15:29', 1),
(569, '\r\nక్రింది వాటిలో బ్రేకు నొక్కినా తర్వాత మీ వాహనం ఏజ్ దూరాన్ని ప్రభావితం చేసే అంశాలేమిటి?\r\n', 4, '', 2, '2019-01-19 17:16:08', 1),
(570, '\r\nరోడ్డుపై ట్రాఫిక్ రద్దీని తగ్గించేందుకు ఏంచేయాలి?\r\n', 4, '', 2, '2019-01-19 17:16:47', 1),
(571, '\r\nపర్యావరణం కాలుష్య నివారణకు మీరు ఎలా దోహదపడతారు?\r\n', 4, '', 2, '2019-01-19 17:17:42', 1),
(572, '\r\nసక్రమంగా సర్వీస్ చేసిన వాహనం వాళ్ళ మీకు...\r\n', 3, '', 2, '2019-01-19 17:18:27', 1),
(573, 'ఎరుపు రంగు (రెడ్) సిగ్నల్ పడిందంటే ఏమని అర్ధం?', 1, 'http://www.piovegovernoladro.info/wp-content/uploads/2016/03/semaforo-660x330.jpg', 2, '2019-01-19 19:20:12', 1),
(574, '\r\nపసుపు రంగు లైట్ ఫ్లాష్ అవుతున్న ఒక జంక్షన్ ఎదురైనప్పుడు ఏంచేయాలి?\r\n', 1, 'https://pbs.twimg.com/media/Djmcex_XcAATkgS.jpg', 0, '2019-01-19 19:22:44', 1),
(575, '\r\nఎరుపు రంగు లైట్ ఫ్లాష్ అవుతున్న ఒక జంక్షన్ ఎదురైనప్పుడు ఎం చేయాలి?\r\n', 3, 'https://nest.com/support/images/light-ring/new-2018/solid-red-status-light.gif', 2, '2019-01-19 19:24:24', 1),
(576, '\r\nఈ ఆకారంలో ఉండే గుర్తు దేనిని సూచిస్తుంది\r\n', 1, 'https://image.made-in-china.com/2f0j00dNBtOLDnEakQ/900mm-900mm-Safety-Circle-Traffic-Signs-Aluminium-Signs.jpg', 2, '2019-01-19 19:26:53', 1),
(577, '\r\nత్రికోణం ఇచ్చిన గుర్తులు దేనికి సంకేతం\r\n', 2, 'http://www.rtoexam.com/themes/images/img112.png', 2, '2019-01-19 19:27:58', 1),
(578, '\r\nఈ ఆకారంలో ఉండే గుర్తు దేనిని సూచిస్తుంది\r\n', 3, 'http://images.clipartpanda.com/rectangle-shape-cli...', 2, '2019-01-19 19:29:04', 1),
(579, 'ఈ చిహ్నం అర్థమేమిటి?', 1, 'https://jhpolice.gov.in/sites/default/files/page/sign-language/jhpolice_sl_mrs1.jpg', 2, '2019-01-19 19:30:23', 1),
(580, '\r\nఈ చిహ్నం అర్థమేమిటి?\r\n', 4, 'https://previews.123rf.com/images/panuwatsexy/panuwatsexy1605/panuwatsexy160500135/58803186-illustration-of-blank-red-triangle-traffic-sign.jpg', 2, '2019-01-19 19:31:21', 1),
(581, '\r\nనువ్వు రోడ్డు మధ్యలోకి వెళ్ళాక నువ్వు ఒక వైపు మాత్రమే ప్రవేశం ఉన్న రోడ్డులో ఉన్నవని తెలుసుకున్నావు. అప్పుడు నువ్వు ఏమి చేస్తావు?\r\n', 3, 'http://surakshitmarg.com/wp-content/uploads/2017/04/4-One-way-sings-vechicle-prohibited-in-one-direction2-300x300.jpg', 2, '2019-01-19 19:33:00', 1),
(582, '\r\nఈ చిహ్నం అర్థమేమిటి?\r\n', 1, 'https://jhpolice.gov.in/sites/default/files/page/s...', 2, '2019-01-19 19:34:03', 1),
(583, '\r\nఈ చిహ్నం అర్థమేమిటి?\r\n', 1, 'https://3.imimg.com/data3/VI/DJ/MY-3598754/emergen...', 2, '2019-01-19 19:35:03', 1),
(584, '\r\nఈ చిహ్నం అర్థమేమిటి?\r\n', 1, 'https://jhpolice.gov.in/sites/default/files/page/sign-language/jhpolice_sl_mrs6.jpg', 2, '2019-01-19 19:36:46', 1),
