(52, '', '*Dutch Reach...*\n\nMany of us, when getting out of Car, do not check the surrounding while opening the door of the vehicle. Seeing if something is coming from the behind before opening the door is crucial. One way to make sure that you always do that is to adopt and practice the technique called *“Dutch Reach”*\n\nNow, what exactly is ‘Dutch Reach’, and how does it save lives..??\n\nThe Dutch Reach is a safety habit that is taught in the driving schools in Netherlands. The method states that you should always reach for the door handle with the farthest hand while getting out of the car. For example, if you’re sitting on the driver seat and want to get out, use your left hand to pull the door handle instead of right.\n\nUsing this technique will automatically ensure that head turns towards the door, with your eyes glancing for moving obstacles coming from behind. This way, you’ll be able to spot if some other vehicle or pedestrian is approaching from the rear. Following this method and making this a habit can save a lot of accidents.', 0, 30, '', '2019-01-20 15:09:54', 0),
